import { Container } from 'react-bootstrap';
import { Row } from 'react-bootstrap';


const News = () => {
    return (
        <section id="aktuelles" className="newsSection">
            <Container style={{maxWidth: 850 + "px"}}>
                <Row>
                    <h2 style={{textAlign: "center"}}>Folge uns</h2>
                    <center>
                        <iframe title="facebookFeed" className="newsFeed" src="httpss://www.facebook.com/plugins/page.php?href=httpss%3A%2F%2Fwww.facebook.com%2FDartfreunde-Geisling-Pfatter-eV-102601505575227&tabs=timeline&width=500&height=600&small_header=false&adapt_container_width=true&hide_cover=false&show_facepile=true&appId" 
                        height="600" scrolling="no" frameBorder="0" allowFullScreen={true} 
                        allow="autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share"></iframe>
                    </center>
                </Row>
            </Container>
        </section>
        )
}

export default News;
